import Home from "./components/Home/Home.js";
import Picker from "./components/Picker/Picker.js";
import Courses from "./components/Courses/Courses.js";
import {BrowserRouter, Switch, Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      Hello world!
      <p>Welcome to the course picker extraordinaire!</p>
      <p>THis app will keep track of courses we have played. (maybe remove the course from the previous week?)</p>
      <BrowserRouter>
        <Switch>
          <Route exact path="/" component={Home}/>
          <Route path="/course-picker" component={Picker}/>
          <Route path="/courses" component={Courses}/>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
